import React from "react"
import * as ReactDOMClient from 'react-dom/client';
import App from './App'
import Bpp from './Bpp'
import './css/main.css'

const app = ReactDOMClient.createRoot(document.getElementById("app"))
const bpp = ReactDOMClient.createRoot(document.getElementById("bpp"))

app.render(<App />)
bpp.render(<Bpp />)
